	<script>
		function fetchSeries() {
		    $.ajax({
			    url: '/data/get/grid/131',
			    datatype: "json",
 			    beforeSend: function(hdr) {
 				  	var chart = $('#container').highcharts();
 			    	chart.showLoading("Gegevens ophalen...");
 			    	return true;
 			    },
			    success: function(data) {
			    	
				  	var chart = $('#container').highcharts();
				  	var min = data["min"]
				  	var max = data["max"]
				  	var options = {
				  			colorAxis: {
				  				min: min[2],
				  				max: max[2]
				  			},
				  			xAxis: {
				  				min: min[0],
			  					max: max[0]
				  			},
				  			yAxis: {
				  				min: min[1],
				  				max: max[1]
				  			}
				  	};
					Highcharts.setOptions(options);
					var key = "grid";
				  	var series = chart.get(key);
					series.setData(data[key]);

			    },
			    error: function(hdr,status,errorThrown) {
			    	alert("Fout tijdens laden van tijdreeks: " + errorThrown);
			    },
 			    complete: function(hdr, status) {
 				  	var chart = $('#container').highcharts();
 			    	chart.hideLoading();
 			    }
		    });
		}
